import Button from './components/Button';
import React, { useState } from './React';

const Counter = () => {
    const [count, setCount] = useState(0);
    return (
        <div>

            <Button Onclick={() => setCount(count + 1)} />
            <Button Onclick={() => setCount(count - 1)} />         
        </div>
    );
}

export default Counter;
